import './Table.css';


function Table() {
    return (
      <div className='container'>
          <div className='row'>Data-1 JSON </div>
          <div className='row full record'>
              <div className='col-auto border'></div>
              <div className='col-auto border'>Identification number</div>
              <div className='col border'>Name</div>
              <div className='col border'>Gender</div>
              <div className='col border'>Risk</div>
              <div className='col border'>Hair length</div>
              <div className='col-auto border'>IQ</div>
              <div className='col-auto border'>Admission date</div>
              <div className='col-auto border'>Last breakdown</div>
              <div className='col-auto border'>Yearly fee</div>
              <div className='col-auto border'>Knows the joker?</div>
              <div className='col-auto border'></div>


          </div>
      </div>
    );
  }

  export default Table;
